const LinkPreview = ({ link, updateClicks }) => {
    const handleClick = () => {
        link.clicks += 1;
        updateClicks(link)
    }
    return (<div className="link-preview" onClick={handleClick}>{link.title}</div>)
}

export default LinkPreview;
